node.bodyText:
Hello,
I want to build an app using Tensor mechanics and Phase field module.
I updated the kernels following the newsletter here - https://mooseframework.inl.gov/newsletter/2020/2020_04.html
Then I tried to build the app in the following way
 cd projects
 ./moose/scripts/stork.sh dendrite

 cd dendrite
added  custom .h files in dendrite/include/kernels and custom.c files in dendrite/src/kernels
 vim Makefile
PHASE_FIELD                 := yes
TENSOR_MECHANICS            := yes
 make -j 4

However, the build is failed. One reason maybe the update of the custom files is not correct and the process of porting them to app is wrong. Can you please guide me to install the app?
.
.
.
.
.
