You can use the "coupled()" routine on temperature to get the index of temperature. Then you should be able to index into derivatives() to retrieve the derivative with regards to temperature. You ll need to get the degree of freedom (dof) index, this can be found from the element or the node.
Either that or if you have a pointer to the variable (using getVar in the constructor for example) then there are "number()" routines.
An example of doing that:
    const Elem * const sided_elem = ssf.face_side;
    const auto dof_number = sided_elem->dof_number(_sys.number(), _var.number(), 0);
    const auto rho_face = _rho(ssf);
    const Real d_rho_face_d_dof = rho_face.derivatives()[dof_number];

